import React from "react";

import classes from '../Create/Create.module.css'
import { AiOutlineCloseCircle } from 'react-icons/ai';
import { useState } from 'react';
import { useSelector } from "react-redux";
import { Navigate, useNavigate } from "react-router-dom";

const Create = () => {

    const [title, setTitle] = useState("");

    const [desc, setDesc] = useState("");

    const [Category, setCategory] = useState("");

    const [image, setImage] = useState("");

    const [price, setPrice] = useState("");

    const [review, setReview] = useState("");

    const navigate = useNavigate();

    const {token} = useSelector((state)=> state.auth); //allowing only correct user


    const onChangeFile = (e) => {

     setImage(e.target.files[0]) // start uploading the file from zero'th index 

    }


    const handleCloseImg = () => {

     setImage('')

    }


    const handleCreateProduct = async (e) => {

      e.preventDefault()

      try{

     const formData = new FormData()

     let filename = null

     if(image){

        filename = Date.now() + image.name //showing current date and time

        formData.append("filename",filename)

        formData.append("image",image)

        await fetch('http://localhost:9000/upload/image',{

        headers:{

         "Authorization":`Bearer ${token}`

        },

        method: "POST",
        body: formData 

        })
     }

     //Here we uploading the products 
     const res = await fetch('http://localhost:9000/product',{

        headers:{
             'Content-Type':'application/json',
             'Authorization':`Bearer ${token}`
        },

        method: "POST",
        body: JSON.stringify({

            title,

            desc,

            Category,

            img: filename,

            price,

            review,

        })
     })

     const food = await res.json()

     Navigate(`/food/${food._id}`)       


    }catch(error){

        console.log(error.message)

    }

    }

    return (

        <div className={classes.container}>
            <div className={classes.wrapper}>
                <h2 className={classes.title}>Create Food Items</h2>

                <form onSubmit={handleCreateProduct} encType="multipart/form-data">
                    <div className={classes.inputWrapper}>
                        <label>Title: </label>
                        <input type="text"
                            placeholder="title"
                            className={classes.input}
                            onChange={(e) => setTitle(e.target.value)} />
                    </div>


                    <div className={classes.inputWrapper}>
                        <label>Description: </label>
                        <input type="text"
                            placeholder="Description"
                            className={classes.input}
                            onChange={(e) => setDesc(e.target.value)} />
                    </div>


                    <div className={classes.inputWrapper}>
                        <label>Category: </label>
                        <input type="text"
                            placeholder="Category"
                            className={classes.input}
                            onChange={(e) => setCategory(e.target.value)} />
                    </div>

                    <div className={classes.inputWrapperImage}>
                        <label htmlFor="image" className={classes.labelFileInput}>Image: <span>Upload here</span></label>
                        <input type="file"
                            id="image"
                            placeholder='Image...'
                            className={classes.input}
                            onChange={onChangeFile}
                            style={{ display: 'none' }}
                        />
                        {image && <p className={classes.imageName}>{image.name} <AiOutlineCloseCircle onClick={handleCloseImg} className={classes.closeIcon} /></p>}
                    </div>



                    <div className={classes.inputWrapper}>
                        <label>Price:</label>
                        <input type="number"
                            step={0.01}
                            placeholder="price"
                            className={classes.input}
                            onChange={(e) => setTitle(e.target.value)} />
                    </div>

                    <div className={classes.inputWrapper}>
                        <label>Review:</label>
                        <input type="number"
                            step={0.01}
                            min={1}
                            max={5}
                            placeholder="review"
                            className={classes.input}
                            onChange={(e) => setReview(e.target.value)} />
                    </div>


                    <div className={classes.buttonWrapper}>
                        <button type="submit" className={classes.submitBtn}>
                            Submit
                        </button>
                    </div>
                </form>

            </div>

        </div>

    )
}

export default Create
